// API Calls
async function getToken() {

    let url = "https://project.trumedianetworks.com/api/token"
    let token = ''

    let xhr = new XMLHttpRequest()
    xhr.open("GET", url)    
    xhr.setRequestHeader("apiKey", "d6ac7457-a1ca-4710-8cff-47991b9ffcc2")
    
    xhr.onreadystatechange = function () {
       if (xhr.readyState === 4) {
          let responseJSON = JSON.parse(xhr.responseText)
          let token = responseJSON.token
          // console.log(xhr.status)
          console.log(token)
       }}
    xhr.send()
}

async function getPlayers(token) {

    let url = "https://project.trumedianetworks.com/api/mlb/players"
    let players = {}

    let xhr = new XMLHttpRequest()
    xhr.open("GET", url)    
    xhr.setRequestHeader("tempToken", token)
    
    xhr.onreadystatechange = function () {
       if (xhr.readyState === 4) {
          let responseJSON = JSON.parse(xhr.responseText)
          console.log(xhr.status)
          players = Object.create(responseJSON)
          console.log(players[0])
       }}
    xhr.send()
}

